@Override
public boolean equals(Object o) {
  if (!(o instanceof GeoStandardPath))
    return false;
  GeoStandardPath p = (GeoStandardPath) o;
  if (!super.equals(p))
    return false;
  if (cutoffAngle != p.cutoffAngle)
    return false;
  return points.equals(p.points);
}

